import "../Style/Test_Menu.css";
import react, { useState } from "react";

const Test_Menu = () => {
  const [isHovering, setIsHovering] = useState(false);
  const handleMouseOver = () => {
    setIsHovering(true);
  };

  const handleMouseOut = () => {
    setIsHovering(false);
  };
  return (
    <div
      className={
        isHovering ? "tabmenu_div_not_hovering" : "tabmenu_div_hovering"
      }
      onMouseOut={handleMouseOut}
      onMouseOver={handleMouseOver}
    >
      <form className="tabmenu_form">
        <div className="font_size_ul">
          <ul className="ul">기타</ul>
        </div>
        <div className="font_size_ul">
          <ul className="ul">작</ul>
        </div>
        <div className="font_size_ul">
          <ul className="ul">기다란거 테스트</ul>
        </div>
      </form>
      <form
        className={
          isHovering ? "tabmenu_form_not_hovering" : "tabmenu_form_hovering"
        }
      >
        <div>
          <li>1-1</li>
          <li>1-2</li>
          <li>1-3</li>
        </div>
        <div>
          <ul>
            <li>2-1</li>
            <li>2-2</li>
            <li>2-3</li>
          </ul>
        </div>
        <ul>
          <li>3-1</li>
          <li>3-2</li>
          <li>3-3</li>
        </ul>
      </form>
    </div>
  );
};

export default Test_Menu;
